import { Component } from 'react';
import dataset from "../../pages/dataset";

interface Dataset {
    name: string,
    path: string,
    credentials?: {

    }
    status: [2]
}
const initalDatasetObject : Dataset = {
    name: '',
    path: '',

    boundedAlluxioCluster: '',


    status: [
        'boundedAlluxioCluster'
    ]

}

class GetDataset extends Component {
    state = {
        serverUrl: 'http://localhost:5220/dataset',
        dataset: initalDatasetObject,
        isLoaded: false,
        error: '',
    };

    componentDidMount() {
        this.fetchData();
    }

    fetchTesting = async () => {
        try {
            const response = await fetch(this.state.serverUrl);
            console.log(response);
        } catch (error) {
            console.log(error);
        }
    };

    fetchData() {
        console.log("Fetch data")
        fetch(this.state.serverUrl)
            .then(res => res.json())
            .then(
                (result) => {
                    console.log(result);
                    console.log(result.items[0].credentials);
                    console.log(result.items[0].status);

                    let currentDatasetObject: Dataset = {
                        name : result.items[0].name,
                        path : result.items[0].path,
                        status : result.items[0].status,
                    }

                    this.setState({
                        isLoaded : true,
                        dataset : currentDatasetObject,
                    });
                },
                (error) => {
                    this.setState({
                        isLoaded: false,
                        error
                    });
                }
            )
    }

    render() {
        const { error, isLoaded, dataset} = this.state;
        if (error) {
            return <div className="GetDataset">Error: {error}</div>;
        } else if (!isLoaded) {
            return <div className="GetDataset">Loading...</div>;
        } else {
            return (
                <div className="GetDataset">

                    <div className='DS Name'>
                        <h3>Data Set Name:</h3>
                        {dataset.name}
                    </div>

                    <div className='DS Path'>
                        <h3>Data Set Status:</h3>
                        {dataset.path}
                    </div>

                    <div className='DS Status'>
                        <h3>Data Set Status:</h3>
                        {dataset.status.boundedAlluxioCluster}
                    </div>

                </div>
            );
        }
    }
}

export default GetDataset
